import React from 'react'
import { Menu } from 'antd';
import { UserOutlined, SearchOutlined } from '@ant-design/icons';
import logo from '../../pages/home/LOGO.png'
import {Link} from 'react-router-dom'

const { SubMenu } = Menu;

class Navbar extends React.Component {
  state = {
    current: 'user',
  };

  handleClick = e => {
    console.log('click ', e);
    this.setState({ current: e.key });
  };

  render() {
    const { current } = this.state;
    return (
      <Menu onClick={this.handleClick} selectedKeys={[current]} mode="horizontal" theme='dark' style={{ backgroundColor: '#5C082A', display:'flex', justifyContent:'flex-end',position:'fixed', width:'100vw'}}>
        <div style={{flexGrow:'1'}}><Link to='/'><img src={logo} style={{height:'2.5rem',marginLeft:'0.5rem'}}></img></Link></div>
        <Link to='/finder'><Menu.Item key="search" icon={<SearchOutlined />}  style={{ backgroundColor: '#5C082A'}} title='FINDER'>
            _FINDER
          <a href="https://ant.design" target="_blank" rel="noopener noreferrer"></a>
        </Menu.Item></Link>
        <SubMenu key="SubMenu" icon={<UserOutlined />} title='_PROFILE' style={{ backgroundColor: '#5C082A'}}>
            <Menu.Item key="setting:1" >YOUR PROFILE</Menu.Item>
            <Menu.Item key="setting:2" >BOOKING</Menu.Item>
            <Menu.Item key="setting:3" >SIGN OUT</Menu.Item>
        </SubMenu>
      </Menu>
    );
  }
}

export default Navbar
